import React from 'react';
import ClassicalCard from './ClassicalCard';
import './ClassicalCardListStyles.scss';

const ClassicalCardList = ({ classicalinfo }) => {
	return(
		<div className='c-info-preview'>
			{
				classicalinfo.map((artist, i) => {
					return (
						<PopCard 
						key={i} 
						id={classicalinfo[i].id} 
						name={classicalinfo[i].name} 
						composition={classicalinfo[i].composition}
						work_type={classicalinfo[i].work_type}
						genre={classicalinfo[i].genre} 
						yt_url={classicalinfo[i].url}
						/>
					);
				})
			}
	   </div> 
	);
}

export default ClassicalCardList;
